import React from "react";
import "./Home.css";
import HomeImgUrl from "../../images/img-1.jpg";
import { Element } from "react-scroll";
import styled from "styled-components";
import { Marginer } from "../../components/marginer";
import { OurSerivce } from "../../components/ourService";
import { SectionTitle } from "../../components/sectionTitle";

import Service1Img from "../../assets/illustrations/web_development_.png";
import Service2Img from "../../assets/illustrations/mobile_phone.png";
import Service3Img from "../../assets/illustrations/bug_fixed.png";

const ServicesContainer = styled(Element)`
  width: 100%;
  min-height: 1100px;
  display: flex;
  flex-direction: column;
  align-items: center;
  padding: 10px 0;
`;

export default function Home() {
  return (
    <div className="home">
      <div className="home-container">
        <div className="home-body">
          <h1> Boared at home?</h1>
          <p>
            Lorem ipsum dolor sit amet consectetur adipisicing elit. Quo dolorem
            doloremque eius ipsa dolorum culpa ut ducimus ipsum et unde,
            sapiente optio cupiditate nobis. Atque qui distinctio impedit quia
            veritatis!
          </p>
        </div>
        <img src={HomeImgUrl} alt="home-img" />
      </div>

      <div className="home-container">
        <div className="home-body">
          <img src={HomeImgUrl} alt="home-img" />
          <h1> Boared at home?</h1>
          <p>
            Lorem ipsum dolor sit amet consectetur adipisicing elit. Quo dolorem
            doloremque eius ipsa dolorum culpa ut ducimus ipsum et unde,
            sapiente optio cupiditate nobis. Atque qui distinctio impedit quia
            veritatis!
          </p>
        </div>
      </div>
    </div>
  );
}
